import React, { Component } from "react";





export class ScorePin extends Component {


  render(){
    const PIN_SIZE = 50
    const scorePinStyle = {
      position: 'absolute',
      width: PIN_SIZE,
      height: PIN_SIZE,
      left: -PIN_SIZE / 2,
      top: -PIN_SIZE / 2
    }
    return <div style={scorePinStyle}>
      <img src='https://waqi.info/mapicon/12.50.png' ></img>
    </div>
  }



}



export default ScorePin
